import React from 'react';
import { useAuth } from '../contexts/AuthContext';
import logoImage from '../assets/img/SignEd_logo.png';

const Header = ({ onNavigate }) => {
    const { logout } = useAuth();
    
    const handleLogout = () => {
        logout();
        onNavigate('landing');
    };

    return (
        <nav className="w-full px-12 py-6 flex justify-between items-center">
            <div className="flex items-center">
                <img src={logoImage} alt="SignEd Logo" className="h-10 mr-2" />
                <span className="text-xl font-bold text-yellow-400">SignEd.</span>
                
                <div className="ml-16 space-x-12">
                    <button 
                        onClick={() => onNavigate('help')} 
                        className="text-white hover:text-yellow-300 transition-colors text-lg"
                    >
                        Panduan
                    </button>
                    <button 
                        className="text-white hover:text-yellow-300 transition-colors text-lg"
                    >
                        Tentang
                    </button>
                </div>
            </div>
            
            <button 
                onClick={handleLogout}
                className="px-6 py-2 text-white hover:text-yellow-300 transition-colors text-lg"
            >
                Logout
            </button>
        </nav>
    );
};

export default Header;
